- основательница Школы этикета в г. Москве
- автор обучающих программ для женщин и детей;
- организатор деловых и светских мероприятий. Мое первое масштабное мероприятие, организованное в Москве - день рождения супруги известного хоккеиста;
- выступала как эксперт по этикету на канале НТВ;
- верю, что мысли формируют реальность. Практик позитивного мышления;
- мое предназначение - делиться своей мудростью и накопленными знаниями по раскрытию женственности и любви к себе;
